import React from 'react';
import { Box, Paper, Typography } from '@mui/material';
import { SEOAnalysisResult } from '../services/seoAnalyzer';

interface MetaTagsAnalyzerProps {
    metaTags: Record<string, string>;
    seoAnalysis: SEOAnalysisResult;
}

const MetaTagsAnalyzer: React.FC<MetaTagsAnalyzerProps> = ({ metaTags, seoAnalysis }) => {
    return (
        <Box sx={{ mt: 4 }}>
            <Typography variant="h5" gutterBottom>SEO Analysis Results</Typography>

            <Paper sx={{ p: 2, mb: 2 }}>
                <Typography variant="h6">Meta Tags</Typography>
                <Box sx={{ mt: 2 }}>
                    {Object.entries(metaTags).map(([key, value]) => (
                        <Box key={key} sx={{ mb: 1 }}>
                            <Typography variant="subtitle2" color="primary">{key}</Typography>
                            <Typography variant="body2">{value}</Typography>
                        </Box>
                    ))}
                </Box>
            </Paper>

            <Paper sx={{ p: 2, mb: 2, bgcolor: seoAnalysis.isValid ? '#e8f5e9' : '#ffebee' }}>
                <Typography variant="h6" gutterBottom>
                    {seoAnalysis.isValid ? 'All Good!' : 'Issues Found'}
                </Typography>

                {seoAnalysis.issues.length > 0 && (
                    <Box sx={{ mb: 2 }}>
                        <Typography variant="subtitle1" color="error">Issues:</Typography>
                        {seoAnalysis.issues.map((issue, index) => (
                            <Typography key={index} variant="body2" color="error">
                                • {issue}
                            </Typography>
                        ))}
                    </Box>
                )}

                {seoAnalysis.suggestions.length > 0 && (
                    <Box>
                        <Typography variant="subtitle1" color="primary">Suggestions:</Typography>
                        {seoAnalysis.suggestions.map((suggestion, index) => (
                            <Typography key={index} variant="body2">
                                • {suggestion}
                            </Typography>
                        ))}
                    </Box>
                )}
            </Paper>
        </Box>
    );
};

export default MetaTagsAnalyzer;
